import React from "react";
import Rate from "./pages/rate/Rate";

export default function App(){
  return (
    <Routes>
      <Route path="/" element={<Rate />} />
      <Route path="/thank-you/:rating" element={<ThankYou />} />
    </Routes>
  )
}
